import React, { useState } from 'react'
import { useMutation, useQueryClient } from '@tanstack/react-query'
import QuickPortfolioReference from './QuickPortfolioReference'
import HourlyCoverageAnalysis from './HourlyCoverageAnalysis'
import { portfolioService } from '../../services/portfolioService'
import { CreatePortfolioData } from '../../types/portfolio.types'
import Button from '../common/Button'
import toast from 'react-hot-toast'

const Dashboard: React.FC = () => {
  const [showForm, setShowForm] = useState(false)
  const [formData, setFormData] = useState<CreatePortfolioData>({
    name: '',
    subtitle: '',
    site_range: '',
  })
  const queryClient = useQueryClient()

  const createMutation = useMutation({
    mutationFn: portfolioService.create,
    onSuccess: () => {
      queryClient.invalidateQueries({ queryKey: ['portfolios'] })
      queryClient.invalidateQueries({ queryKey: ['portfolio-activity'] })
      toast.success('Portfolio created successfully!')
      setFormData({ name: '', subtitle: '', site_range: '' })
      setShowForm(false)
    },
    onError: (error: any) => {
      toast.error(error.response?.data?.error || 'Failed to create portfolio')
    },
  })

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault()
    if (!formData.name.trim()) {
      toast.error('Portfolio name is required')
      return
    }
    createMutation.mutate(formData)
  }

  return (
    <div className="space-y-6 w-full">
      <QuickPortfolioReference />

      {/* Portfolio Creation Section */}
      <div className="bg-white rounded-lg shadow-md p-6">
        <div className="flex items-center justify-between mb-4">
          <h2 className="text-2xl font-bold text-gray-900">Create New Portfolio</h2>
          <Button
            onClick={() => setShowForm(!showForm)}
            variant={showForm ? 'secondary' : 'primary'}
          >
            {showForm ? 'Cancel' : '+ Create Portfolio'}
          </Button>
        </div>

        {showForm && (
          <form onSubmit={handleSubmit} className="space-y-4 pt-4 border-t border-gray-200">
            <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
              <div>
                <label htmlFor="name" className="block text-sm font-medium text-gray-700 mb-2">
                  Portfolio Name <span className="text-red-500">*</span>
                </label>
                <input
                  id="name"
                  type="text"
                  value={formData.name}
                  onChange={(e) => setFormData({ ...formData, name: e.target.value })}
                  required
                  className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2"
                  style={{ '--tw-ring-color': '#6fb13b' } as React.CSSProperties & { '--tw-ring-color': string }}
                  onFocus={(e) => {
                    e.currentTarget.style.boxShadow = '0 0 0 2px #6fb13b'
                  }}
                  onBlur={(e) => {
                    e.currentTarget.style.boxShadow = ''
                  }}
                  placeholder="e.g., Solar Farm North"
                />
              </div>

              <div>
                <label htmlFor="subtitle" className="block text-sm font-medium text-gray-700 mb-2">
                  Subtitle (Optional)
                </label>
                <input
                  id="subtitle"
                  type="text"
                  value={formData.subtitle}
                  onChange={(e) => setFormData({ ...formData, subtitle: e.target.value })}
                  className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2"
                  style={{ '--tw-ring-color': '#6fb13b' } as React.CSSProperties & { '--tw-ring-color': string }}
                  onFocus={(e) => {
                    e.currentTarget.style.boxShadow = '0 0 0 2px #6fb13b'
                  }}
                  onBlur={(e) => {
                    e.currentTarget.style.boxShadow = ''
                  }}
                  placeholder="e.g., Locus System"
                />
              </div>

              <div>
                <label htmlFor="site_range" className="block text-sm font-medium text-gray-700 mb-2">
                  Site Range (Optional)
                </label>
                <input
                  id="site_range"
                  type="text"
                  value={formData.site_range}
                  onChange={(e) => setFormData({ ...formData, site_range: e.target.value })}
                  className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2"
                  style={{ '--tw-ring-color': '#6fb13b' } as React.CSSProperties & { '--tw-ring-color': string }}
                  onFocus={(e) => {
                    e.currentTarget.style.boxShadow = '0 0 0 2px #6fb13b'
                  }}
                  onBlur={(e) => {
                    e.currentTarget.style.boxShadow = ''
                  }}
                  placeholder="e.g., Sites 1-50"
                />
              </div>
            </div>

            <div className="flex justify-end gap-3 pt-2">
              <Button
                type="button"
                variant="secondary"
                onClick={() => {
                  setShowForm(false)
                  setFormData({ name: '', subtitle: '', site_range: '' })
                }}
              >
                Cancel
              </Button>
              <Button type="submit" isLoading={createMutation.isPending}>
                Create Portfolio
              </Button>
            </div>
          </form>
        )}
      </div>

      <HourlyCoverageAnalysis />
    </div>
  )
}

export default Dashboard
